import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Home from './pages/Home';
import SignIn from './components/SignIn.js';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import Features from './pages/Features';
import Pricing from './pages/Pricing';
import Contact from './pages/Contact';
import ProtectedRoute from './components/ProtectedRoute';
import Jobs from './pages/Jobs';
import Customers from './pages/Customers';
import ManageJobs from './pages/ManageJobs';
import LoginSuccess from './components/LoginSuccess';
import ManageCustomers from './pages/ManageCustomers';
import Profile from './pages/Profile';
import BuildRoutes from './pages/BuildRoutes/BuildRoutes.js';
import ManageEmployees from './pages/ManageEmployees';
import Employee from './pages/Employee';
import CustomerNotifications from './components/CustomerNotifcations.js';
import CustomerGrowthAnalytics from './components/CustomerGrowthAnalytics';
import RevenueAnalytics from './components/RevenueAnalytics';
import JobStatisticsAnalytics from './components/JobStatisticsAnalytics';
import EmployeePerformanceAnalytics from './components/EmployeePerformanceAnalytics';


function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/signin" element={<SignIn />} />
            <Route path="/register" element={<Register />} />
            <Route path="/features" element={<Features />} />
            <Route path="/pricing" element={<Pricing />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/login-success" element={<LoginSuccess />} />

            {/* Protected Routes */}
            <Route 
              path="/dashboard" 
              element={
                <ProtectedRoute>
                  <Dashboard />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/jobs" 
              element={
                <ProtectedRoute>
                  <Jobs />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/customers" 
              element={
                <ProtectedRoute>
                  <Customers />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/manage-jobs" 
              element={
                <ProtectedRoute>
                  <ManageJobs />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/manage-customers" 
              element={
                <ProtectedRoute>
                  <ManageCustomers />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/profile" 
              element={
                <ProtectedRoute>
                  <Profile />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/build-routes" 
              element={
                <ProtectedRoute>
                  <BuildRoutes />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/manage-employees" 
              element={
                <ProtectedRoute>
                  <ManageEmployees />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/add-employee" 
              element={
                <ProtectedRoute>
                  <Employee />
                </ProtectedRoute>
              } 
            />
             <Route 
              path="/notifications" 
              element={
                <ProtectedRoute>
                  <CustomerNotifications />
                </ProtectedRoute>
              } 
            />
             <Route 
              path="/analytics/customer-growth" 
              element={
                <ProtectedRoute>
                  <CustomerGrowthAnalytics />
                </ProtectedRoute>
              } 
            />
             <Route 
              path="/analytics/revenue" 
              element={
                <ProtectedRoute>
                  <RevenueAnalytics />
                </ProtectedRoute>
              } 
            />
             <Route 
              path="/analytics/job-statistics" 
              element={
                <ProtectedRoute>
                  <JobStatisticsAnalytics />
                </ProtectedRoute>
              } 
            />
             <Route 
              path="/analytics/employee-performance" 
              element={
                <ProtectedRoute>
                  <EmployeePerformanceAnalytics />
                </ProtectedRoute>
              } 
            />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
